import React from "react";
import "../scss/components/header.scss";

import Logo from "../assets/icon-header.png";

const Header = () => {
  return (
    <nav className="padding-h-3-nm navbar is-fixed-top bg-white">
      <div className="padding-l-4-om navbar-brand">
        <div className="navbar-item padding">
          <div className="header-title">
            Queensland Academy of Sport
          </div>

          <img src={ Logo } alt="" />
        </div>
      </div>
    </nav>
  );
}

export default Header;
